import React from 'react';
import { motion } from 'framer-motion';
import { ExternalLink, CheckCircle, XCircle, Clock } from 'lucide-react';

const HistoryTable = () => {
  const historyData = [
    {
      id: 1,
      title: 'Summer Marketing Campaign',
      date: '2024-01-15',
      hash: '0x4a7b9c83e45d29f8b7a6c2d1e...',
      status: 'signed',
    },
    {
      id: 2,
      title: 'Product Launch Announcement',
      date: '2024-01-14',
      hash: '0x8d3e92a47b1c6f5a2e9d8c7b...',
      status: 'pending',
    },
    {
      id: 3,
      title: 'Weekly Newsletter',
      date: '2024-01-13',
      hash: '0x2b5c8a9d7e3f1a4c6b9e8d2a...',
      status: 'signed',
    },
    {
      id: 4,
      title: 'Social Media Posts',
      date: '2024-01-12',
      hash: '0x7e4a9c2b8d6f3a1e5b9c7d8a...',
      status: 'failed',
    },
  ];

  const getStatusIcon = (status) => {
    switch (status) {
      case 'signed':
        return <CheckCircle className="h-5 w-5 text-green-400" />;
      case 'pending':
        return <Clock className="h-5 w-5 text-yellow-400" />;
      case 'failed':
        return <XCircle className="h-5 w-5 text-red-400" />;
      default:
        return null;
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'signed':
        return 'bg-green-500/20 text-green-400 border-green-400/30';
      case 'pending':
        return 'bg-yellow-500/20 text-yellow-400 border-yellow-400/30';
      case 'failed':
        return 'bg-red-500/20 text-red-400 border-red-400/30';
      default:
        return '';
    }
  };

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1
    }
  };

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      className="gradient-border rounded-2xl"
    >
      <div className="glass-morphism rounded-2xl p-8">
        <h2 className="text-2xl font-bold text-white mb-6">Content History</h2>
        
        <motion.div
          variants={containerVariants}
          initial="hidden"
          animate="visible"
          className="overflow-hidden rounded-xl"
        >
          {/* Table Header */}
          <div className="grid grid-cols-12 gap-4 px-6 py-4 bg-white/10 border-b border-white/10 text-sm font-medium text-gray-300">
            <div className="col-span-4">Title</div>
            <div className="col-span-3">Date</div>
            <div className="col-span-3">Hash</div>
            <div className="col-span-2 text-center">Status</div>
          </div>

          {/* Table Rows */}
          {historyData.map((item, index) => (
            <motion.div
              key={item.id}
              variants={itemVariants}
              whileHover={{ scale: 1.02, backgroundColor: 'rgba(255,255,255,0.05)' }}
              className="grid grid-cols-12 gap-4 px-6 py-4 border-b border-white/10 text-white cursor-pointer transition-all duration-300"
            >
              <div className="col-span-4 font-medium">{item.title}</div>
              <div className="col-span-3 text-gray-300">{item.date}</div>
              <div className="col-span-3">
                <code className="text-sm text-purple-300 font-mono">
                  {item.hash}
                </code>
              </div>
              <div className="col-span-2 flex items-center justify-center">
                <motion.span
                  whileHover={{ scale: 1.1 }}
                  className={`inline-flex items-center gap-1 px-3 py-1 rounded-full border text-sm font-medium ${getStatusColor(item.status)}`}
                >
                  {getStatusIcon(item.status)}
                  {item.status.charAt(0).toUpperCase() + item.status.slice(1)}
                </motion.span>
              </div>
            </motion.div>
          ))}
        </motion.div>

        {/* View All Button */}
        <motion.button
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          className="w-full mt-6 py-3 glass-morphism border border-white/20 hover:border-white/40 rounded-xl font-semibold text-white transition-all duration-300 flex items-center justify-center gap-2"
        >
          <ExternalLink size={18} />
          View All History
        </motion.button>
      </div>
    </motion.div>
  );
};

export default HistoryTable;
